;; Two part mixture
(defdist mixture [dist1 dist2 mixingprop]
  (sample* [this] (if (sample* (flip mixingprop)) (sample* dist1) (sample* dist2)))
  (observe* [this value]
          (Math/log (+ (* mixingprop (Math/exp (observe* dist1 value))) (* (- 1 mixingprop ) (Math/exp (observe* dist2 value)))))))

;; Multi component mixture
(defdist multi-mixture [list-of-distributions list-of-probabilities]
  (sample* [this] (sample* 
                    (sample* 
                      (categorical 
                        (into {} 
                          (map vector list-of-distributions list-of-probabilities))))))
  (observe* [this value]
          (Math/log 
            (sum 
              (map (fn [x y] (Math/exp (* (observe* x value ) y)) ) list-of-distributions list-of-probabilities)))))



;; Bayesian nonparametrics for use in state space models
(defdist categorical-dp-ind
  "categorical distribution extended
  by a random sample, for use with DP-ind"
  [counts H alpha] [dist (categorical
                           (vec (conj counts [::new alpha])))]
  (sample* [this]
    (let [s (sample* dist)]
      ;; When a `new' value is drawn, sample the actual
      ;; value from the base measure.
      ;; We return a pair of the value and an indicator to say
      ;; if we drew the value from the base distribution (true) or
      ;; from the previously seen values (false).
      (if (= s ::new) [(sample* H) true] [s false])))
  (observe* [this value]
    (log-sum-exp
      ;; The value is one of absorbed values.
      (observe* dist (first value))
      ;; The value is drawn from the base distribution.
      (+ (observe* dist ::new) (observe* H (first value))))))
      ;; Note that in the definition of observe*, we have a choice if we
      ;; require the use to supply a pair [value indicator] or simply a value.
      ;; Here, we have chosen the former. However, our code does not call observe on
      ;; the DP, so this code is not executed at all.

(defproc DP-ind
  "Dirichlet process from which we can produce distributions over
  pairs [value indicator] (rather than the mere values of DP), where 
  indicator shows whether the draw was produced from the base distribution (true)
  or from a previously seen value (false)"
  [alpha H] [counts {}]
  (produce [this] (categorical-dp-ind counts H alpha))
  (absorb [this sample]
          (DP-ind alpha H (update-in counts [sample] (fnil inc 0)))))
