;; @@
(with-primitive-procedures
  [shape 
   mmul 
   model-params
   mixture
   DP-ind]
  (defquery sticky-hdp-hmm
    "Sticky HDP-HMM"
    [observations]
    (let
      [ ;; ==== Initialize Processes for State Transitions ====

        alpha-trans-0 (sample (model-params :alpha-trans-0-prior))
        _ (store "state-transition-base-process" (DP alpha-trans-0 
