(def model-params
  {
    ;; HDP prior
  	:alpha-trans-0-prior (gamma 1 5)
  	:alpha-trans-prior (gamma 1 5)			
    :trans-dist (normal 0 1)
    
    ;; Emission prior
    :cov-mat-scale (gamma 5 5) ;; (uniform-continuous 0.25 2.0)
    :inverse-cov-scale (gamma 1 0.75);; (uniform-continuous 0.05 2.0)	
    
    
    ;; IDHMM
    :alpha-dur-0-prior (gamma 2 1)
    :alpha-dur-prior (gamma 2 1)
    :dur-dist (multi-mixture [(poisson 10) (poisson 30) (poisson 100)] [0.25 0.25 0.5])})

  
  
(comment  
(def model-params
  {
  	:alpha-trans-0-prior (gamma 5 1)
  	:alpha-trans-prior (gamma 5 1)
    :trans-dist (normal 0 1)
    
    ;; emission prior
    :cov-mat-scale 0.75						
    :inverse-cov-scale (gamma 1 1)	
    
    ;; sticky HDP-HMM, stateful HDP-HMM
    :kappa-prior (gamma 5 1)
    
    ;; IDHMM, stateful IDHMM
    :alpha-dur-0-prior (categorical {1000 1})
    :alpha-dur-prior (categorical {1000 1})
    :dur-dist (uniform-discrete 50 150)}) ;;(categorical {30 0.3 70 0.7})
  
