;; **
;;; # Plot results
;; **

;; @@
;; Map to lowest state number
(def remapstates (fn [listofstates] 
                   (let [oldstates (distinct listofstates)
                         newstates (range (count oldstates))
                         oldtonew (into {} (map vector oldstates newstates))] 
                                      (map oldtonew listofstates))))

(def plot-range [[0 550] [-1 1]])
(def get-max-latent-seq
  "gets the max-logweight latent sequence from the resulting samples"
  (fn [samples]
    (let [L (get (apply max-key :log-weight samples) :result)]
    	 (map first L)))) ;; (into []  L) ;; (map first L)

;; Set plotting aspect ratio
(def ar 1.4)

(apply plot/compose
[(plot/list-plot (into [] (map first observations))
                :joined true
                :x-title "Time"
                :aspect-ratio ar
                :plot-range plot-range
                :y-title "Magnitude"
                :color "red")

(plot/list-plot (into [] (map second observations))
                :joined true
                :x-title "Time"
                :aspect-ratio ar
                :plot-range plot-range
                :y-title "Magnitude"
                :color "blue")])

(apply plot/compose
  [(plot/list-plot (remapstates (get-max-latent-seq samples)) ;; (map first  synthetic-states-and-durations)
                  :joined true
                  :opacity 0.5
                  :color "blue"
                  :x-title "Time"
                  :aspect-ratio ar
                  :y-title "Magnitude"
                  :plot-range [[0 550] [0 20]])

   (plot/list-plot GT
                  :joined true
                  :opacity 0.6
                  :color "black"
                  :x-title "Time"
                  :aspect-ratio ar
                  :y-title "Magnitude"
                  :plot-range plot-range)])  
       

(plot/histogram (remapstates (get-max-latent-seq samples))
                :colour "#ff0000" 
                :bins 50
                :x-title "# State"
                :aspect-ratio ar
                :y-title "Count")
