;; **
;;; # Synthetic data experiments
;; **

;; @@
;; Define data and parameters

(def time-series-length 1000)


(def obs-dists {0 (mvn [1 -1] [[3 0] [0 2]])
                1 (mvn [-1 1] [[2 0] [0 3]])
                2 (mvn [0 0] [[2.5 0] [0 2]])})

(def dur-dists {0 (categorical {25 0.3 50 0.30 75 0.25 100 0.15})
                1 (categorical {25 0.3 50 0.30 75 0.25 100 0.15})
                2 (categorical {25 0.3 50 0.30 75 0.25 100 0.15})})

(def trans-dists {0 (discrete [0.0001 0.2999 0.7])
                  1 (discrete [0.7 0.0001 0.2999])
                  2 (discrete [0.8 0.1999 0.0001])})


;; Equal prob of entering first state
(def initial-state-distribution 
  (discrete [1.0 1.0 1.0]))

;; (def initial-duration-distribution
  ;; (uniform-discrete 25 50))

(def initial-duration-distribution
  (categorical {25 0.3 50 0.30 75 0.25 100 0.15}))

  
;; State space model evolution

(def synthetic-states-and-durations
  (let [transition-duration
        (fn [S D]
          (if (< 1 D)
            (- D 1)
            (sample* (dur-dists S))))

        transition-state
        (fn [S D]
          (if (< 1 D)
            S
            (sample* (trans-dists S))))

        markov-step
        (fn [prev-item]
          (let [s (transition-state (first prev-item) (second prev-item))]
            [s (transition-duration s (second prev-item))]))]

    (reduce                     
      (fn [states-and-durations _]
        (let [s_d (markov-step (peek states-and-durations))] 
          (conj states-and-durations s_d)))
      (let [s (sample* initial-state-distribution)  
            d (sample* initial-duration-distribution)]
        [[s d]])
      (range (- time-series-length 1)))))

(def synthetic-emissions
  (map 
    (fn [s_d] (sample* (obs-dists (first s_d))))
     (rest synthetic-states-and-durations)))

;; Set plotting aspect ratio
(def ar 1.75)
(def plotRange [:all [0 3]])

(apply plot/compose
       [(plot/list-plot (into [] (map first synthetic-emissions))
                :joined true
                :aspect-ratio ar
                :x-title "Time"
                :y-title "Signal Magnitude"
                :color "green")

        (plot/list-plot (into [] (map second synthetic-emissions))
                :joined true
                :aspect-ratio ar
                :x-title "Time"
                :y-title "Magnitude")])

(plot/list-plot (into [] (map first synthetic-states-and-durations))
                :joined true
                :color (nth plot-colors 3)
                :x-title "Time"
                :aspect-ratio ar
                :y-title "State"
                :plot-range plotRange)

(plot/histogram (into [] (map first synthetic-states-and-durations))
                :colour "#ff0000" 
                :x-title "# State"
                :bins 10
                :y-title "Count")
