;; Map to lowest state number
(def remapstates (fn [listofstates] 
                   (let [oldstates (distinct listofstates)
                         newstates (range (count oldstates))
                         oldtonew (into {} (map vector oldstates newstates))] 
                                      (map oldtonew listofstates))))

;; Load data for synthetic experiments
(def synthetic-emissions (load-data-from-file "src/synthetic/UAI-synthetic-emissions-experiment.csv"))
(def synthetic-states-and-durations (load-data-from-file "src/synthetic/UAI-synthetic-emissions-ground-truth.csv"))
