(def model-params
  {
    ;; HDP prior
  	:alpha-trans-0-prior (gamma 1 1)
  	:alpha-trans-prior (gamma 1 1)			
    :trans-dist (normal 0 1)
    
    ;; Emission prior
    :cov-mat-scale 0.75    				;; Murphy p. 133
    :inverse-cov-scale 0.1				;; Murphy p. 133
    
    ;; sticky HDP-HMM, stateful HDP-HMM specifics
    :kappa-prior (gamma 2 1)
    
    ;; IDHMM
    :alpha-dur-0-prior (gamma 1 1)
    :alpha-dur-prior (gamma 1 1)
    :dur-dist (mixture (poisson 35) (poisson 85) 0.5)})

;; (mixture (normal 35 15) (normal 85 15) 0.5)
;; (mixture (poisson 35) (poisson 85) 0.5)
;; (uniform-discrete 25 100)


(def number-of-particles 10)
(def number-of-samples 10)
(def samples
  (->> (doquery :smc 
                (load-string "idhmm")
                [synthetic-emissions]
                :number-of-particles number-of-particles)
       (take number-of-samples)
       doall
       time))
