(def plot-range [[0 1000] [0 5]])
(def get-max-latent-seq
  "gets the max-logweight latent sequence from the resulting samples"
  (fn [samples]
    (let [L (get (apply max-key :log-weight samples) :result)]
    	 (map first L)))) ;; (into []  L) ;; (map first L)

(apply plot/compose
       [(plot/list-plot (into [] (map first synthetic-emissions))
                :joined true
                :x-title "Time"
                :plot-size 500
                :y-title "Magnitude"
                :color "green")

(plot/list-plot (into [] (map second synthetic-emissions))
                :joined true
                :x-title "Time"
                :plot-size 500
                :y-title "Magnitude"
                :color "red")])

(apply plot/compose
       [(plot/list-plot  (remapstates (get-max-latent-seq samples))
                :joined true
                :color "red"
                :opacity 1.5         
                :x-title "Time"
                :plot-size 500
                :y-title "Magnitude"
                :plot-range plot-range)

(plot/list-plot (map first  synthetic-states-and-durations)
                :joined true
                :opacity 0.5
                :color "blue"
                :x-title "Time"
                :plot-size 500
                :y-title "Magnitude"
                :plot-range plot-range)])

(plot/histogram (get-max-latent-seq samples)
                :colour "#ff0000" 
                :bins 10
                :x-title "# State"
                :plot-size 500
                :y-title "Count")
