;; **
;;; ## Hamming distance functions
;; **

;; @@
;; Haming distance function
(def hammingdistance (fn [x y]
                       (sum 
                         (map (fn [a b] (if (= a b) 0 1)) x y))))


;; Fint distinct in sequence
(def preproc (fn [x]
               (let [symbols (distinct x)
                     mapping (into {} (map vector symbols (range (count symbols))))]
                 (map mapping x))))


;; Symbol permutations
(def symbolpermutations (fn [x]
                          (let [symbols (distinct x)
                                symbolsallperms (c/permutations symbols)
                                topermutationfunction 
                                (fn [permutedsymbols] 
                                  (into {} (map vector symbols permutedsymbols)))
                                permutationfunctions 
                                (map topermutationfunction symbolsallperms)]
                            (map (fn [z] (map z  x )) permutationfunctions))))


;; Find minimum Hamming distance 
(def minhammingdistance (fn [x y]
                   (apply min 
                          (map 
                            (fn [z] (hammingdistance (preproc x) z))
                            (symbolpermutations (preproc y))))))

;; Set Hamming datum instance
(def createminhammingdatum (fn [model groundtruth emissions numpart]
     (let [ _ (println "Starting query for number of particles:")
            _ (println numpart)
            samples (->> (doquery :smc 
                                  model
                                  [emissions]
                                  :number-of-particles numpart)
                         (take 100) 			;; SAMPLES
                         doall
                         time)    				;; TIME
            fittedsequence  
            (map first (into [] (get (apply max-key :log-weight samples) :result))) 			;; watch out here if hdp-hmm: produces only states, no durations
            numstates (count (distinct fittedsequence))]
       [(minhammingdistance groundtruth fittedsequence) numstates])))


;; Function that writes Hamming data
(def createminhammingdata 
  (fn [model groundtruth emissions stepsize numsteps numrepeats]
    (map 
      (fn [numb] 
        (reduce concat 
                (repeatedly numrepeats 
                            #(createminhammingdatum model groundtruth emissions numb))))
      (map (fn [x] (* stepsize x)) (map (fn [x] (+ 1 x)) (range numsteps))))))

(defn expn [x n]
  (reduce * (repeat n x)))

;; Function that writes Hamming data
(def createminhammingdata-exp
  ;; DO NOT USE ANGLICAN PRIMITIVE >> RETURNS FLOAT
  (fn [model groundtruth emissions stepsize numsteps numrepeats]
    (map 
      (fn [numb] 
        (reduce concat 
                (repeatedly numrepeats 
                            #(createminhammingdatum model groundtruth emissions numb))))
      (map (fn [x] (expn stepsize x)) (map (fn [x] (+ 1 x)) (range numsteps))))))
